      SELECT ALL 63 FROM tab0 (FORMAT parquet) WHERE NOT col1 IN ( - CAST ( + ( col1 ) AS INTEGER ), col0 * - col2, col2 );
  - name: tab0

outputs:
  - name: q6103.out
    data: |
      63
      63
      63
